import React from "react";
import {
  EmailShareButton,
  EmailIcon,
  FacebookShareButton,
  FacebookIcon,
  LinkedinShareButton,
  LinkedinIcon,
  TwitterShareButton,
  TwitterIcon,
} from "react-share";

function Footer() {
  const shareUrl = 'https://engagementtracker.net'

  return (
    <div className="footer">
      <div className="footerText">v0.1</div>
      <LinkedinShareButton className="socialButton" url={shareUrl} >
        <LinkedinIcon size='2.4vh' round={true} />
      </LinkedinShareButton>
      <TwitterShareButton className="socialButton" url={shareUrl} >
        <TwitterIcon size='2.4vh' round={true} />
      </TwitterShareButton>
      <FacebookShareButton className="socialButton" url={shareUrl} >
        <FacebookIcon size='2.4vh' round={true} />
      </FacebookShareButton>
      <EmailShareButton className="socialButton" url={shareUrl} >
        <EmailIcon size='2.4vh' round={true} />
      </EmailShareButton>
    </div>
  );
}

export default Footer;
